import React from 'react';
// import image from 'image.jpg';
const MainBody = () => {
    return (
        <div style={{display:"inline-flex"}}>
            <div style={{width:"65%"}}><img style={{width:"100%", height:"100%"}} src="/Images/image.jpg" /></div>
            <div style={{width:"35%",border:"2px solid blue"}} ></div>
        </div>
    );
};


export default MainBody ;
